import React from 'react'
import { Link } from 'react-router-dom';

const EVENTS= [
  { id:'e1', title:'event1'},
  { id:'e2', title:'event2'},
  { id:'e3', title:'event3'},
]

const EventsPage = () => {
  return (
    <div>
      <h1>events</h1>
      <ul> 
        {
          EVENTS.map((e) => {
            return (
              <li key={e.id}>
                   <Link to={`/events/${e.id}`}>{e.title}</Link>
              </li>
            )
          })
        }
      </ul>
    </div>
  )
}

export default EventsPage;
